TUTORIAL50 = "You now have a keyring to hold your keys.This |cffffd200Keyring Button|r appears to the left of your bags on your action bar.";
TUTORIAL51 = "You can enter dungeons or find groups for dungeons by using the |cffffd200Dungeon Finder|r. The Dungeon Finder is accessed from the eye button near the middle of your action bar.";
TUTORIAL52 = "Congratulations, you have received your first companion. This little fellow will follow you during all of your adventures in Azeroth and beyond.|n|nYou can see all of your companions by clicking the |cffffd200Spellbook Button|r and then looking for the  |cffffd200Companions|r tab.";
TUTORIAL53 = "Congratulations, you have learned how to summon your first mount. This mighty steed will carry you throughout your adventures in Azeroth and beyond.|n|nTo see all of your mounts, click the |cffffd200Spellbook Button|r and look for the |cffffd200Mounts|r tab. You can drag your favorite mount onto your action bar to summon it more easily.";
